import java.util.Scanner;

class  Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int t = sc.nextInt();
        StringBuilder out = new StringBuilder();
        for (int i = 0; i < t; i++) {
            int n = sc.nextInt();
            int m = sc.nextInt();
            int[][] board = new int[n][m];
            for (int j = 0; j < n; j++) {
                for (int k = 0; k < m; k++) {
                    board[j][k] = sc.nextInt();
                }
            }
            int[][] boardSum = new int[n][m];
            for (int j = 0; j < m; j++) {
                boardSum[0][j] = board[0][j];
            }

            if (m != 1) {
                for (int j = 1; j < n; j++) {
                    for (int k = 0; k < m; k++) {
                        if (k == 0) {
                            boardSum[j][k] = Math.max(boardSum[j - 1][k] + board[j][k],
                                    boardSum[j - 1][k + 1] + board[j][k]);
                        } else if (k == m - 1) {
                            boardSum[j][k] = Math.max(boardSum[j - 1][k] + board[j][k],
                                    boardSum[j - 1][k - 1] + board[j][k]);
                        } else {
                            boardSum[j][k] = Math.max(
                                    Math.max(boardSum[j - 1][k] + board[j][k], boardSum[j - 1][k + 1] + board[j][k]),
                                    boardSum[j - 1][k - 1] + board[j][k]);
                        }
                    }
                }
                long max = Long.MIN_VALUE;
                for (int j = 0; j < m; j++) {
                    max = Math.max(boardSum[n - 1][j], max);
                }
                out.append(max).append("\n");
            } else {
                long sum = 0;
                for (int j = 0; j < n; j++) {
                    sum += board[j][0];
                }
                out.append(sum).append("\n");
            }

        }
        System.out.println(out);
    }
}
